def find_next(current, vals):
    possible = []
    for i, val in enumerate(vals):
        flag = False
        for j in zip(val, current):
            if j[0] == 1 and j[1] == 1:
                flag = True
                break
        if not flag:
            possible.append((i, val))
    return possible

def take_one(arr):
    vals = []
    for idx in range(64):
        xx, val = step_recur(arr[idx], arr[:idx] + arr[idx + 1:], 1)
        if xx == "YES":
            vals.append([(idx, arr[idx])] + val)
    return vals

def recalc(x, y):
    ret = []
    for i in zip(x, y):
        if i[0] == i[1]:
            ret.append(i[0])
        else:
            if i[0] == 1:
                ret.append(0)
            else:
                ret.append(1)
    return ret

def step_recur(current, tail, step):
    if tail == []:
        return ("YES", [])
    pos = find_next(current, tail)
    if pos == []:
        return ("NO", [])
    for i in pos:
        newcurr = recalc(current, i[1])
        val = step_recur(newcurr, tail[:i[0]] + tail[i[0] + 1:], step + 1)
        if val[0] == "YES":
            return ("YES", [i] + val[1])
    return ("NO", [])

def get_key(valz, arr):
    ret = []
    for i in valz:
        ret.append(arr.index(i[1]))
    return ret

vals = take_one(arr)
for i in vals:
    keyposs = get_key(i, arr)
    print("".join([chr(x) for x in keyposs]).encode('utf-8').hex())